function Top(props) {
    let css = {
        top : {
            width: '100%',
            height: '70px',
            backgroundColor: 'grey',

        },
        topImg : {
            height: '70px',

        },
        ul : {
            listStyleType: 'none',
            width: '450px',
            display: 'flex',
            justifyContent: 'space-between'
        }
    }

    return (
        <div style={css.top}>
            <img src={props.img} alt="логотип" style={css.topImg}/>
            <ul style={css.ul}>
                <li>Home</li>
                <li>About</li>
                <li>Services</li>
                <li>Blog</li>
                <li>Contact</li>
            </ul>


        </div>
    );
}

export default Top;
